-- Inserts pour la table papers
-- Indices papier plac√©s sur les photos

SET NAMES utf8mb4;
SET CHARACTER SET utf8mb4;

ON DUPLICATE KEY UPDATE 
    photo_id = VALUES(photo_id),
    position_left = VALUES(position_left),
    position_top = VALUES(position_top),
    scale_x = VALUES(scale_x),
    scale_y = VALUES(scale_y),
    angle = VALUES(angle),
    z_index = VALUES(z_index),
    updated_at = CURRENT_TIMESTAMP;

